    "7302501": {
        "Desc": "前往「桓那兰那」所在之处",
        "Step": "顺着兰拉娜留下的踪迹，寻找桓那兰那吧。既然只有这样才能帮助拉娜。",
        "Talk": [
            [
                {
                    "N": "_1005",
                    "T": "但是…真的要唱歌吗？万一引来了骗骗花…"
                },
                {
                    "N": "_0",
                    "T": "虽然说唱歌，但借助乐器也可以吧。"
                },
                {
                    "N": "_1005",
                    "T": "嗯，值得试试。我们去维摩庄问问，看阿玛兹亚爷爷有没有什么乐器吧！"
                }
            ]
        ]
    },
    "7302502": {
        "Desc": "前往「桓那兰那」所在之处",
        "Talk": [
            [
                {
                    "N": "_1005",
                    "T": "阿玛兹亚爷爷…"
                },
                {
                    "N": "阿玛兹亚",
                    "T": "哦哦，是拉娜的朋友啊…很遗憾，拉娜那孩子，今天应该去巡林喽。"
                },
                {
                    "N": "_0",
                    "T": "（他似乎还不知道拉娜的事情…）"
                },
                {
                    "N": "_1005",
                    "T": "（那我们就别跟爷爷说吧…）"
                },
                {
                    "N": "_0",
                    "T": "（既然如此，我们保密吧…）"
                },
                {
                    "N": "_1005",
                    "T": "嗯，我们知道啦！我们是想问问阿玛兹亚爷爷，有没有什么「乐器」，能借给我们用一用？"
                },
                {
                    "N": "阿玛兹亚",
                    "T": "乐器吗…你们等一下，爷爷这就拿来。"
                },
                {
                    "N": "???",
                    "T": "阿玛兹亚从屋里取来了一副老旧的乐器。"
                },
                {
                    "N": "_1005",
                    "T": "看起来…像是蒙德风格的乐器呢！阿玛兹亚爷爷，能借给我们吗？"
                },
                {
                    "N": "阿玛兹亚",
                    "T": "好久好久以前…我当年在林子里遇到了一个吟游诗人。作为信物，她把琴留给了我。"
                },
                {
                    "N": "阿玛兹亚",
                    "T": "「花园的梦，森林的记忆…石榴歌唱，苹果鼓掌…」"
                },
                {
                    "N": "阿玛兹亚",
                    "T": "多好的曲子啊…"
                },
                {
                    "N": "阿玛兹亚",
                    "T": "就借给你们吧，用琴声点亮林子里黑漆漆的地方，看看她能不能听到…"
                },
                {
                    "N": "_0",
                    "T": "我们会好好保管的。"
                },
                {
                    "N": "_0",
                    "T": "我们会好好演奏的。"
                },
                {
                    "N": "_1005",
                    "T": "嗯！我们会还给你的，阿玛兹亚爷爷！谢谢！"
                }
            ]
        ]
    },
