    "7302507": {
        "Desc": "「帮助兰那罗」",
        "Talk": [
            [
                {
                    "N": "_1005",
                    "T": "欸？这就是桓那兰那…好多兰那罗…"
                },
                {
                    "N": "_0",
                    "T": "好像是同一个地方，但是…"
                },
                {
                    "N": "_1005",
                    "T": "嗯嗯我懂！感觉完全不一样！"
                },
                {
                    "N": "_1005",
                    "T": "不过，既然按照兰拉娜的说法，已经到了桓那兰那，那接下来就是取得惟耶之实帮助拉娜了。"
                },
                {
                    "N": "_0",
                    "T": "我们需要「惟耶之实」。"
                },
                {
                    "N": "_1005",
                    "T": "嗯，按照兰拉娜的说法，我们要到桓那兰那取得惟耶之实。这样才能帮助拉娜。"
                },
                {
                    "N": "兰罗摩",
                    "T": "惟耶之实吗…我听过它的故事。"
                },
                {
                    "N": "兰罗摩",
                    "T": "嗯。总之，这里就是真正的桓那兰那。但准确来说是「玛哈桓那兰那薜那」…"
                },
                {
                    "N": "_1005",
                    "T": "好、好长的名字！而且「那」字好多！"
                },
                {
                    "N": "兰罗摩",
                    "T": "嗯。不过因为名字太长，所以我们一般不这样称呼它。用那菈的话来说…"
                },
                {
                    "N": "兰罗摩",
                    "T": "啊，对了，是「梦中的兰那罗森林」这样的意思。"
                },
                {
                    "N": "_1005",
                    "T": "「梦」…也就是说…"
                },
                {
                    "N": "_0",
                    "T": "也就是说刚刚的桓那兰那才是现实？"
                },
                {
                    "N": "_0",
                    "T": "也就是说我们现在在梦中？"
                },
                {
                    "N": "兰罗摩",
                    "T": "嗯。那是好久好久以前的故事，那时候我连种子都还不是，还在沙恒中沉睡。但桓那兰那毁灭一次后，我们就住在这个梦里。"
                },
                {
                    "N": "_1005",
                    "T": "原来还有这样的过去…"
                },
                {
                    "N": "兰罗摩",
                    "T": "很可怕的！听说，天空都变成了黑色，大树像大风吹过的原野上的草一样，全部倒下了。然后，到处都是很吓人的怪物。"
                },
                {
                    "N": "兰罗摩",
                    "T": "幸好那些都是故事，不是记忆。总之，如果要离开桓那兰那的梦，就对着修梨薜那唱大梦的曲调。想要回来的话，也一样。"
                },
                {
                    "N": "兰罗摩",
                    "T": "跟我来吧。惟耶之实的事情，兰拉迦会想办法的。"
                }
            ]
        ]
    },
