    "7306918": {
        "Desc": "前往指定地点，寻找与觉树之堂有关的线索",
        "Step": "依照兰加惟的说法，兰耶娑、兰陀娑和兰修提袈分别在野外寻找「觉树之堂」的线索。兰罗摩也会去与他们会合。如果遇见他们，就与他们一起寻找「觉树之堂」吧。毕竟，这似乎是取得「恒素果」的关键。",
        "Talk": [
            [
                {
                    "N": "_1005",
                    "T": "这就是…"
                },
                {
                    "N": "兰罗摩",
                    "T": "嗯。这就是恒素果。"
                },
                {
                    "N": "兰罗摩",
                    "T": "恒素果是莎兰树积聚梦想和记忆，结出来的。对于我们来说，是能让我们恢复力量的宝贵果实。"
                },
                {
                    "N": "兰罗摩",
                    "T": "要让「觉王之树」长出惟耶之实，需要消耗大量的力量。所以，我们要拿恒素果去供养他。"
                },
                {
                    "N": "兰罗摩",
                    "T": "#那菈{NICKNAME}，要好好保管恒素果喔！"
                },
                {
                    "N": "_1005",
                    "T": "嗯…既然如此，我们教兰罗摩「宝藏」的意思吧！"
                },
                {
                    "N": "_1005",
                    "T": "宝藏就是很珍贵的东西的意思。你看，恒素果有很多梦想和记忆，而且能让兰那罗恢复力量，很厉害、很稀有对吧！"
                },
                {
                    "N": "_1005",
                    "T": "像恒素果这样，很珍贵、很重要的东西，这就是宝藏喔！"
                },
                {
                    "N": "兰罗摩",
                    "T": "哦哦！原来宝藏是这样的意思…我知道了！谢谢派蒙！"
                },
                {
                    "N": "_0",
                    "T": "接下来要做什么？"
                },
                {
                    "N": "_1005",
                    "T": "唔…记得之前兰拉迦说了，好像要不止一个恒素果。这样的话，我们还要找别的觉树之堂吧？"
                },
                {
                    "N": "_0",
                    "T": "谢谢派蒙！"
                },
                {
                    "N": "_1005",
                    "T": "真是的，你在说什么呀…记得之前兰拉迦说了，好像要不止一个恒素果。这样的话，我们还要找别的觉树之堂吧？"
                },
                {
                    "N": "兰罗摩",
                    "T": "#嗯。我会努力！那菈{NICKNAME}、派蒙，我们之后再见吧！"
                },
                {
                    "N": "_1005",
                    "T": "嗯！之后再见啦，兰罗摩！"
                }
            ]
        ]
    },
    "7306903": {
        "Desc": "与兰罗摩对话",
        "Step": "在野外，见到了兰罗摩与之前没见过的兰那罗…",
        "Talk": [
            [
                {
                    "N": "_1005",
                    "T": "我们又见面啦！兰罗摩！"
                },
                {
                    "N": "兰罗摩",
                    "T": "#喔！那菈{NICKNAME}和派蒙，你们好呀！"
                },
                {
                    "N": "兰罗摩",
                    "T": "嗯。他是兰耶娑。我们寻找觉树之堂的时候，在这里遇到了。"
                },
                {
                    "N": "_1005",
                    "T": "兰耶娑你好！"
                },
                {
                    "N": "_0",
                    "T": "你好！"
                },
                {
                    "N": "兰耶娑",
                    "T": "#「接下来唱的是…一位{M#小姐}{F#少年}，追寻至珍之物的诗。在旅途开始时，{M#她}{F#他}双眸的颜色是没有一丝阴霾的琥珀…」"
                },
                {
                    "N": "_1005",
                    "T": "…？"
                },
                {
                    "N": "_0",
                    "T": "感觉怪怪的…"
                },
                {
                    "N": "_0",
                    "T": "是吟游诗人？"
                },
                {
                    "N": "兰罗摩",
                    "T": "嗯。兰耶娑是「采歌者」，经常去收集各种各样的歌曲。兰耶娑他是采歌的兰那罗里胆子最大的，所以会经常学到那菈的诗歌。"
                },
                {
                    "N": "兰耶娑",
                    "T": "「我们的宿命，是一同诞生的珍珠…」"
                },
                {
                    "N": "_0",
                    "T": "完全没办法交流…"
                },
                {
                    "N": "_0",
                    "T": "「啊啊，那罪恶般甜蜜的宿命。」"
                },
                {
                    "N": "_1005",
                    "T": "#噫——{NICKNAME}，快停下！"
                },
                {
                    "N": "兰罗摩",
                    "T": "#那菈{NICKNAME}好厉害！和兰耶娑的歌一样，完全听不懂！"
                },
                {
                    "N": "_1005",
                    "T": "言归正传…这里就是觉树之堂吗？"
                },
                {
                    "N": "兰罗摩",
                    "T": "啊。不是的，但这也是很厉害的发现。在这里，沉睡着很多年没有兰那罗找到的歌。"
                },
                {
                    "N": "兰罗摩",
                    "T": "兰那罗的采歌者，会一直一直追求歌的美丽。所以，在时间的最后，会把只属于自己的歌留下。"
                },
                {
                    "N": "_0",
                    "T": "那和觉树之堂有关吗？"
                },
                {
                    "N": "兰罗摩",
                    "T": "嗯！这边似乎是兰拉吉留下的歌。如果是这样的话，附近应该就有莎兰树了。"
                },
                {
                    "N": "_0",
                    "T": "祝你们好运。"
                },
                {
                    "N": "兰罗摩",
                    "T": "#嗯！谢谢那菈{NICKNAME}。这边似乎是兰拉吉留下的歌。如果是这样的话，附近应该就有莎兰树了。运气很好！"
                },
                {
                    "N": "_1005",
                    "T": "莎兰树…之前兰拉迦好像说过，就是那个什么来着，我看看森林书…"
                },
                {
                    "N": "_1005",
                    "T": "#莎兰树！就是能结出恒素果的莎兰树！我们也帮忙吧，{NICKNAME}！"
                },
                {
                    "N": "兰耶娑",
                    "T": "「啊啊，这份思念，会结出像石榴一样血红的果实。即使命运将你的双眼蒙上…」"
                },
                {
                    "N": "_0",
                    "T": "既然是帮助拉娜所需要的…"
                },
                {
                    "N": "_0",
                    "T": "「也无法夺走唇边的歌…」"
                },
                {
                    "N": "_1005",
                    "T": "#噫——{NICKNAME}，你在干什么啦！好奇怪喔！"
                },
                {
                    "N": "兰罗摩",
                    "T": "#那菈{NICKNAME}应该和兰耶娑很合得来呢！"
                },
                {
                    "N": "_1005",
                    "T": "#不要鼓励{M#他}{F#她}啦！"
                },
                {
                    "N": "兰罗摩",
                    "T": "嗯，总之，在那些玫瑰当中，隐藏着歌曲。唔…但是，我和兰耶娑看了好久好久，都没找到。那些玫瑰，也不和我们说话。"
                },
                {
                    "N": "_1005",
                    "T": "#原来如此…{NICKNAME}，我们也调查一下看看吧！"
                },
                {
                    "N": "_0",
                    "T": "交给我吧。"
                },
                {
                    "N": "_1005",
                    "T": "嗯！找东西嘛，我们很擅长的，对吧！"
                },
                {
                    "N": "_0",
                    "T": "「我会点亮你的诗。」"
                },
                {
                    "N": "_1005",
                    "T": "……"
                }
            ]
        ]
    },
